// components/TopBar.js

import React from 'react';
import './TopBar.css';

function TopBar() {
    return (
        <div className="top-bar">
            <ul>
                <li><a href="#">Home</a></li>
                <li><a href="#">About</a></li>
                <li><a href="#">Services</a></li>
                <li><a href="#">Contact</a></li>
            </ul>
        </div>
    );
}

export default TopBar;
